import {lazy} from 'react';
import {
  HOME_PATH,
  NEWS_PATH
} from './main.paths.constant';

export const COMMON_ROUTES = [
  {
    path: HOME_PATH,
    title: 'Welcome',
    screen: lazy(() => import('../../screens/home.screen')),
  }, 
  {
    path: NEWS_PATH,
    title: 'News',
    screen: lazy(() => import('../../screens/news.screen')),
  }
];
